INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_description`, `field_instruments`, `field_duration`, `field_performers`, `field_video`, `field_mediaFormat`, `field_year`, `field_subHeading`, `field_authorName`, `field_authorUrl`, `field_allowDownload`, `field_metaKeywords`, `field_metaDescription`, `field_token`, `field_staff`, `field_unknown`, `field_metaUrl`, `field_metaSongDescription`, `field_metaImage`, `field_metaTitle`, `field_metaSongTitle`, `field_fullName`, `field_role`, `field_promotionText`, `field_texts`, `field_email`, `field_address`, `field_socialNetwork`, `field_copyright`, `field_members`, `field_copyrightShort`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('48', '49', 'en_us', 'J.S. Bach- Suite No.2 in B minor  BWV 1067- Badinerie mvt. 77', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-02 05:40:00', '2013-08-02 05:40:00', 'b54b55f6-332b-425a-9f18-80e77a0f5f1f');
INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_description`, `field_instruments`, `field_duration`, `field_performers`, `field_video`, `field_mediaFormat`, `field_year`, `field_subHeading`, `field_authorName`, `field_authorUrl`, `field_allowDownload`, `field_metaKeywords`, `field_metaDescription`, `field_token`, `field_staff`, `field_unknown`, `field_metaUrl`, `field_metaSongDescription`, `field_metaImage`, `field_metaTitle`, `field_metaSongTitle`, `field_fullName`, `field_role`, `field_promotionText`, `field_texts`, `field_email`, `field_address`, `field_socialNetwork`, `field_copyright`, `field_members`, `field_copyrightShort`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('50', '51', 'en_us', 'Suite No.2 in B minor', NULL, NULL, '<p>\r\n	   The four orchestral suites (called ouvertures by their author), BWV 1066–1069 are four suites by Johann Sebastian Bach. The name ouverture refers only in part to the opening movement in the style of the French overture, in which a majestic opening section in relatively slow dotted-note rhythm in duple meter is followed by a fast fugal section in triple meter, then rounded off with a short recapitulation of the opening music. More broadly, the term was used in Baroque Germany for a suite of dance-pieces in French Baroque style preceded by such an ouverture. This genre was extremely popular in Germany during Bach\'s day, and he showed far less interest in it than was usual: Robin Stowell writes that \"Telemann\'s 135 surviving examples [represent] only a fraction of those he is known to have written\";[1] Christoph Graupner left 85 (listed in his Wikipedia entry); and Johann Friedrich Fasch left almost 100 (listed in his Wikipedia entry). Bach did write several other ouverture (suites) for solo instruments, notably the Cello Suite no. 5, BWV 1011, which also exists in the autograph Lute Suite in G minor, BWV 995, the Keyboard Partita no. 4 in D, BWV 828, and the Overture in the French style, BWV 831 for keyboard. The two keyboard works are among the few Bach published, and he prepared the lute suite for a \"Monsieur Schouster,\" presumably for a fee, so all three may attest to the form\'s popularity,\r\n</p>\r\n<p>\r\n	   Scholars believe that Bach did not conceive of the four Orchestral Suites as a set (in the way he conceived of the Brandenburg Concertos), since the sources are various, as detailed below.\r\n</p>', '[{\"col1\":\"Flute\"},{\"col1\":\"Viola\"}]', '0000-00-00 00:00:00', 'Bach', '', 'audio', '1980', NULL, NULL, NULL, 'y', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-02 05:45:12', '2013-08-02 05:50:55', '726ad34f-f47f-4fac-be94-ee6baf80b6da');
