INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_description`, `field_instruments`, `field_duration`, `field_performers`, `field_video`, `field_mediaFormat`, `field_year`, `field_subHeading`, `field_authorName`, `field_authorUrl`, `field_allowDownload`, `field_metaKeywords`, `field_metaDescription`, `field_token`, `field_staff`, `field_unknown`, `field_metaUrl`, `field_metaSongDescription`, `field_metaImage`, `field_metaTitle`, `field_metaSongTitle`, `field_fullName`, `field_role`, `field_promotionText`, `field_texts`, `field_email`, `field_address`, `field_socialNetwork`, `field_copyright`, `field_members`, `field_copyrightShort`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('72', '73', 'en_us', 'By the Light of Nature', NULL, NULL, '<p>\r\n	  The perception of achieving the concept of leaving blank for imagination to run without having the standard traditional Chinese music\'s hetrophony is the main topic of this work.</p><p>\r\n	 Performance Review</p><p>\r\n	 The other premiere (played by all four musicians) was contemporary composer Chen Hsin-Lei’s By the Light of Nature, a musical realization of the concept of “nothingness” or “blankness,” described in the notes as “one of the spiritual cores of Chinese art.” To give you a partial idea of that concept, imagine something that is hidden from you, like a village that you can’t see because there’s a mountain in front of it. This most impressive work included some apparently pre-recorded digital sounds, thus it interrupt performers\' sense of coordination to count together. Performers can grad a hint or find their own clue of tempo from the tape part. Instruments are the color. Linearly, each instrument has limited freedom of it\'s own pulse. Their unique timbre gives diversity of texture. However, there are points they meet up together to create tension and resolve. Each single one of them has its sound world, yet, together, they are one work in harmony, a pleasing state of agreement or orderly combination of elements in a whole.</p>', '[{\"col1\":\"dizi\"},{\"col1\":\"sheng\"},{\"col1\":\"huqing\"},{\"col1\":\"pipa\"},{\"col1\":\"computer music\"}]', '6:59', '[{\"col1\":\"conductor\",\"col2\":\"Aikhai Peng\"}]', '', 'audio', '2012', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-26 16:54:46', '2015-02-01 19:58:06', '25ebaa43-7cd3-4efd-a5b4-12d1bca26a37');
