INSERT INTO `craft_content` (`id`, `elementId`, `locale`, `title`, `field_heading`, `field_body`, `field_description`, `field_instruments`, `field_duration`, `field_performers`, `field_video`, `field_mediaFormat`, `field_year`, `field_subHeading`, `field_authorName`, `field_authorUrl`, `field_allowDownload`, `field_metaKeywords`, `field_metaDescription`, `field_token`, `field_staff`, `field_unknown`, `field_metaUrl`, `field_metaSongDescription`, `field_metaImage`, `field_metaTitle`, `field_metaSongTitle`, `field_fullName`, `field_role`, `field_promotionText`, `field_texts`, `field_email`, `field_address`, `field_socialNetwork`, `field_copyright`, `field_members`, `field_copyrightShort`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('179', '180', 'en_us', 'Rustling Leaves', NULL, NULL, '<p>\r\n	In Rustling Leaves I am trying to depict the sound of leaves. The music is about the special experience of the great nature.  These is a mandarin term that I could not understand, which is “山濤”. It means “mountain waves”. Until one day, I went to a park. I was surrounded by trees. While wind was blowing, the sound of leaves was almost like ocean’s waves. For a moment, I thought that I am by the beach. The only difference was that the “waves” actually go thought my body. I felt like that I am floating in the air with the ebb and flow. Up and down, up and down…</p>', '[{\"col1\":\"violin\"},{\"col1\":\"viola\"}]', '9:42', '[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Nick Naegele\"},{\"col1\":\"viola\",\"col2\":\"Momchil Monchev\"}]', '', 'audio', '1998', NULL, NULL, NULL, 'n', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '2013-08-26 21:53:54', '2015-02-01 19:18:45', '9cd3cd12-a2d9-4673-a84b-85f577d3269d');
