INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('81', '73', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"By the Light of Nature\",\"slug\":\"by-the-light-of-nature\",\"postDate\":1377536040,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"74\",\"75\"],\"41\":[\"76\"],\"3\":\"<p>\\r\\n\\t The perception of achieving the concept of leaving blank for imagination to run without having the standard traditional Chinese music\'s hetrophony is the main topic of this work.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tPerformance Review\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe other premiere (played by all four musicians) was contemporary composer Chen Hsin-Lei\\u2019s By the Light of Nature, a musical realization of the concept of \\u201cnothingness\\u201d or \\u201cblankness,\\u201d described in the notes as \\u201cone of the spiritual cores of Chinese art.\\u201d To give you a partial idea of that concept, imagine something that is hidden from you, like a village that you can\\u2019t see because there\\u2019s a mountain in front of it. This most impressive work included some apparently pre-recorded digital sounds, thus it interrupt performers\' sense of coordination to count together. Performers can grad a hint or find their own clue of tempo from the tape part. Instruments are the color. Linearly, each instrument has limited freedom of it\'s own pulse. Their unique timbre gives diversity of texture. However, there are points they meet up together to create tension and resolve. Each single one of them has its sound world, yet, together, they are one work in harmony, a pleasing state of agreement or orderly combination of elements in a whole.\\r\\n<\\/p>\",\"8\":\"6:59\",\"7\":[{\"col1\":\"dizi\"},{\"col1\":\"sheng\"},{\"col1\":\"huqing\"},{\"col1\":\"pipa\"},{\"col1\":\"computer music\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"conductor\",\"col2\":\"Aikhai Peng\"}],\"10\":\"\",\"14\":\"\"}}', '2013-08-26 16:56:24', '2013-08-26 16:56:24', '2061c75b-6368-473c-b871-7af2e827530f');
