INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('113', '116', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Willow Catkins\",\"slug\":\"willow-catkins\",\"postDate\":1377546346,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"114\",\"113\"],\"41\":[\"115\"],\"3\":\"<p>\\r\\n\\tWillow catkins fly in the wind like snow dancing under sunshine. Everything is like a dream. Everything freezes at that moment. Time does not move. Forever, perhaps exists in somewhere we see and do not see.\\r\\n<\\/p>\",\"8\":\"7:17\",\"7\":[{\"col1\":\"violin\"},{\"col1\":\"computer music\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Hsiang-chun Chien\"}],\"10\":\"\",\"14\":\"1999\"}}', '2013-08-26 19:45:46', '2013-08-26 19:45:46', 'b0ace534-a8af-4a9b-bbed-c3da570d13f5');
