INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('165', '184', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"In THE Love\",\"slug\":\"in-the-love\",\"postDate\":1377554575,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"182\",\"181\"],\"41\":[\"183\"],\"3\":\"<p>\\r\\n\\tLove is not to die for, not to possess, but to let it be. No matter in love or losing one, you should set the other free.\\r\\n<\\/p>\",\"8\":\"6:44\",\"7\":[{\"col1\":\"violin\"},{\"col1\":\"cello\"},{\"col1\":\"piano\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Jingye Zhang\"},{\"col1\":\"cello\",\"col2\":\"Song Zhao\"},{\"col1\":\"piano\",\"col2\":\"Jia Lin Zhang\"}],\"10\":\"\",\"14\":\"2011\"}}', '2013-08-26 22:02:55', '2013-08-26 22:02:55', '7985c6c0-69ec-4af0-b1ac-eea9277e14fe');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('166', '55', '2', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Chamber\",\"slug\":\"chamber\",\"postDate\":1377518460,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"40\":[\"53\"],\"13\":[\"65\",\"132\",\"136\",\"140\",\"144\",\"148\",\"152\",\"156\",\"160\",\"164\",\"168\",\"172\",\"176\",\"26\",\"180\",\"184\"]}}', '2013-08-26 22:03:13', '2013-08-26 22:03:13', '2246a1ad-2a4f-444d-91f6-dd718afaace3');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('167', '188', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"The Glance\",\"slug\":\"the-glance\",\"postDate\":1377611567,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"185\",\"186\"],\"41\":[\"187\"],\"3\":\"<p>\\r\\n\\tStarts with the beginning of a pop song, \\\"Because of the glance of you among people, I can\'t forget your face.\\\" After the glance, you are stuck. Everything is already written; is destined. I was a very rational; love life was never my priority. Thus I could not understand Johannes Brahms\' love to the one woman through out life. Until I met a person, i realized that staying quietly beside Clara might have been the only thing Brahms wished for. I love this person more and more, day by day. The happier I felt; the more painful I experienced.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe piece describes the contrasts in between the extreme emotions, from tonal to atonal;  from purity to density; from rational to emotional. Life is a process of repeating and circulating, however, every time, it does not go back to exactly same place; it changes a little.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe piece ends in E major, which is a major this higher than the beginning. It contains quotation another pop song, At Least I Have You, \\\"I am afraid that it\'s gonna be too late, and I am going to hold you tight\\\", which is symbolization of sublime.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tNo matter what, I am thankful that I loved.\\r\\n<\\/p>\",\"8\":\"5:14\",\"7\":[{\"col1\":\"violin\"},{\"col1\":\"cello\"},{\"col1\":\"piano\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"}],\"10\":\"\",\"14\":\"2008\"}}', '2013-08-27 13:52:48', '2013-08-27 13:52:48', '1191ed58-59e3-4d29-aee6-3e94d0b4b354');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('168', '55', '2', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Chamber\",\"slug\":\"chamber\",\"postDate\":1377518460,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"40\":[\"53\"],\"13\":[\"65\",\"132\",\"136\",\"140\",\"144\",\"148\",\"152\",\"156\",\"160\",\"164\",\"168\",\"172\",\"176\",\"26\",\"180\",\"184\",\"188\"]}}', '2013-08-27 13:52:59', '2013-08-27 13:52:59', 'c2f92311-9556-427c-8d24-8ac1273a867f');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('169', '192', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Immaculate Snow\",\"slug\":\"immaculate-snow\",\"postDate\":1377611759,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"189\",\"190\"],\"41\":[\"191\"],\"3\":\"<p>\\r\\n\\tThe title in Chinese means \\\"the lean air and light after thunderstorm or snowstorm.\\\" Deeper meaning is about being calm in this material world.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tI was inspired by the last snow in Beijing. It snowed heavily. The snow\'s crystal was very light and large, so it looks like feather. I was standing in front of a huge glass. The snow was so light so it flowed in the air sometimes up towards the sky. I felt like that I was in a glass snow ball. The snow leaned up the city and covered every noise. The world was full of tranquility.\\r\\n<\\/p>\",\"8\":\"7:23\",\"7\":[{\"col1\":\"string quartet\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Can Gao and YaJing Su\"},{\"col1\":\"viola\",\"col2\":\"WenTing Kang\"},{\"col1\":\"cello\",\"col2\":\"YiChen Yang\"}],\"10\":\"\",\"14\":\"2004\"}}', '2013-08-27 13:55:59', '2013-08-27 13:55:59', 'b635cb9a-4d87-42dd-8e07-0d7ea98eea75');
