INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('179', '212', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Tinkly Jade\",\"slug\":\"tinkly-jade\",\"postDate\":1377612856,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"209\",\"210\"],\"41\":[\"211\"],\"3\":\"<p>\\r\\n\\tIn an empty palace that is so quiet, even the tinkling sound of jade hung on concubine\'s belt can be heard easily.\\r\\n<\\/p>\",\"8\":\"10:19\",\"7\":[{\"col1\":\"marimba\"},{\"col1\":\"string quartet\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Jingye Zhang\"},{\"col1\":\"marimba\",\"col2\":\"Bingye Chen\"},{\"col1\":\"string orchestra\",\"col2\":\"EOS orchestra\"}],\"10\":\"\",\"14\":\"2007\"}}', '2013-08-27 14:14:17', '2013-08-27 14:14:17', 'f26b1f6d-e7ef-445f-b918-d265415bb1f8');
