INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('183', '220', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"The Four Immeasurable\",\"slug\":\"the-four-immeasurable\",\"postDate\":1377613291,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"218\",\"217\"],\"41\":[\"219\"],\"3\":\"<p>\\r\\n\\tWish everything has happiness and the cause of happiness.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWish everything has no bitterness and away from the cause of bitterness.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWish everything has luck and the cause of luck.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tWish everything has no hatry, desire, lust and anger.\\r\\n<\\/p>\",\"8\":\"8:28\",\"7\":[{\"col1\":\"soprano\"},{\"col1\":\"alto\"},{\"col1\":\"tenor\"},{\"col1\":\"bass\"},{\"col1\":\"mixed choir\"},{\"col1\":\"orchestra\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Jun-Chiang Chiu\"},{\"col1\":\"orchestra\",\"col2\":\"Taipei Philharmonics\"}],\"10\":\"\",\"14\":\"2007\"}}', '2013-08-27 14:21:31', '2013-08-27 14:21:31', '2fac8334-25b8-4dec-8a11-0e85bbf9352a');
