INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('215', '270', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Renascence\",\"slug\":\"renascence\",\"postDate\":1377618281,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"267\",\"268\"],\"41\":[\"269\"],\"3\":\"<p>\\r\\n\\tArt is life in a deferent tempo.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tCountless natural disasters happened in recent years. On on hand, thinking about that there are people suffering somewhere out there makes me worried. But on the other hand, knowing that there are people devoting themselves for a better world comforts me.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tThe piece to that is to marvel human wisdom, and to show respect for the power of nature. I pray for the lives in miseries in the past, the present, and the future.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\tIn the end of the music, I hope the audience can hum with the performers with Mahler\'s Resurrection to find the peace on our heart. Maestro Fusao Kajim once described, \\\"just like going back to Mother\'s embrace.\\\"\\r\\n<\\/p>\",\"8\":\"10:59\",\"7\":[{\"col1\":\"flute\"},{\"col1\":\"clarinet\"},{\"col1\":\"bassoon\"},{\"col1\":\"trombone\"},{\"col1\":\"percussion\"},{\"col1\":\"piano\"},{\"col1\":\"string quartet\"},{\"col1\":\"contrabass\"},{\"col1\":\"tape\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Fusao Kajim\"},{\"col1\":\"orchestra\",\"col2\":\"National Taiwan Orchestra Symphony\"}],\"10\":\"\",\"14\":\"2003\"}}', '2013-08-27 15:44:41', '2013-08-27 15:44:41', '5ea0c32f-93a3-4a74-bbc6-a4d2f9c92818');
