INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('240', '228', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"\'V\' to Transformative Lightness of Beings\",\"slug\":\"v-to-transformative-lightness-of-beings\",\"postDate\":1377613980,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"4\":[\"225\",\"226\"],\"41\":[\"227\"],\"3\":\"<p>\\r\\n\\t Maestro Hu, Yongyen told me, \\\"Hsin-Lei, give me Wagner. We want Wagner.\\\" And I though, \\\"It\'s about time to go back to German style.\\\"\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t This piece is inspired by Wagner\'s Valkyrie, and quoted many leitmotivs.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t Wagner\'s aesthetics to war, violence, destroy and the pleasant comes afterwards are too excitingly brutal for me to accept. There is no fatherly-kind reliable and warm spirit in the opera; it\'s restless. It\'s reality. It\'s way too close to us. After being through the delicatly-processed agony and force, here comes the hope and eager for piece.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t Beethoven\'s motive, orchestration, phrasing and chord is the foundation of this piece. If Wagner is the deep ocean that can swallow and destroy everything, Beethoven is the broad sea that give the world life. With Beethoven\'s spirit, there is courage to floor in the waves of thunderstorm.\\r\\n<\\/p>\\r\\n<p>\\r\\n\\t This piece is about struggling. Struggle in between hope and desperation, against lust and desire like black hole of humanity, and yet, after everything have been through, still peruse the brightness, the reflection of sun, the light of the promise land.\\r\\n<\\/p>\",\"8\":\"19:24\",\"7\":[{\"col1\":\"orchestra\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"conductor\",\"col2\":\"Xu, Zhi Lian\"},{\"col1\":\"orchestra\",\"col2\":\"EOS orchestra\"}],\"10\":\"\",\"14\":\"2005\"}}', '2013-08-29 20:51:52', '2013-08-29 20:51:52', '6246c63b-a9d0-4417-a31a-328d149df4b3');
