INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('273', '180', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Rustling Leaves\",\"slug\":\"rustling-leaves\",\"postDate\":1377553980,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"5\":[\"402\"],\"4\":[\"178\",\"177\"],\"41\":[\"179\"],\"3\":\"<p>\\r\\n\\tIn Rustling Leaves I am trying to depict the sound of leaves. The music is about the special experience of the great nature.  These is a mandarin term that I could not understand, which is \\u201c\\u5c71\\u6fe4\\u201d. It means \\u201cmountain waves\\u201d. Until one day, I went to a park. I was surrounded by trees. While wind was blowing, the sound of leaves was almost like ocean\\u2019s waves. For a moment, I thought that I am by the beach. The only difference was that the \\u201cwaves\\u201d actually go thought my body. I felt like that I am floating in the air with the ebb and flow. Up and down, up and down\\u2026<\\/p>\",\"8\":\"9:42\",\"7\":[{\"col1\":\"violin\"},{\"col1\":\"viola\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Nick Naegele\"},{\"col1\":\"viola\",\"col2\":\"Momchil Monchev\"}],\"12\":\"\",\"10\":\"\",\"14\":\"1998\"}}', '2015-02-01 19:18:45', '2015-02-01 19:18:45', '209101d4-883c-443e-97de-8f4416c29082');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('274', '184', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"In THE Love\",\"slug\":\"in-the-love\",\"postDate\":1377554520,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"5\":[\"405\",\"406\"],\"4\":[\"182\",\"181\"],\"41\":[\"183\"],\"3\":\"<p>\\r\\n\\tLove is not to die for, not to possess, but to let it be. No matter in love or losing one, you should set the other free.<\\/p>\",\"8\":\"6:44\",\"7\":[{\"col1\":\"violin\"},{\"col1\":\"cello\"},{\"col1\":\"piano\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Jingye Zhang\"},{\"col1\":\"cello\",\"col2\":\"Song Zhao\"},{\"col1\":\"piano\",\"col2\":\"Jia Lin Zhang\"}],\"12\":\"\",\"10\":\"\",\"14\":\"2011\"}}', '2015-02-01 19:35:52', '2015-02-01 19:35:52', 'b99e88db-1176-4e41-b873-10432e39e472');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('275', '192', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Immaculate Snow\",\"slug\":\"immaculate-snow\",\"postDate\":1377611700,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"5\":[\"407\"],\"4\":[\"189\",\"190\"],\"41\":[\"191\"],\"3\":\"<p>\\r\\n\\tThe title in Chinese means \\\"the lean air and light after thunderstorm or snowstorm.\\\" Deeper meaning is about being calm in this material world.<\\/p><p>\\r\\n\\tI was inspired by the last snow in Beijing. It snowed heavily. The snow\'s crystal was very light and large, so it looks like feather. I was standing in front of a huge glass. The snow was so light so it flowed in the air sometimes up towards the sky. I felt like that I was in a glass snow ball. The snow leaned up the city and covered every noise. The world was full of tranquility.<\\/p>\",\"8\":\"7:23\",\"7\":[{\"col1\":\"string quartet\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Can Gao and YaJing Su\"},{\"col1\":\"viola\",\"col2\":\"WenTing Kang\"},{\"col1\":\"cello\",\"col2\":\"YiChen Yang\"}],\"12\":\"\",\"10\":\"\",\"14\":\"2004\"}}', '2015-02-01 19:44:05', '2015-02-01 19:44:05', '6368f2c4-f080-49c4-9a96-c8fbfcedf289');
