INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('277', '192', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"Immaculate Snow\",\"slug\":\"immaculate-snow\",\"postDate\":1377611700,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"5\":[\"408\"],\"4\":[\"189\",\"190\"],\"41\":[\"191\"],\"3\":\"<p>\\r\\n\\tThe title in Chinese means \\\"the lean air and light after thunderstorm or snowstorm.\\\" Deeper meaning is about being calm in this material world.<\\/p><p>\\r\\n\\tI was inspired by the last snow in Beijing. It snowed heavily. The snow\'s crystal was very light and large, so it looks like feather. I was standing in front of a huge glass. The snow was so light so it flowed in the air sometimes up towards the sky. I felt like that I was in a glass snow ball. The snow leaned up the city and covered every noise. The world was full of tranquility.<\\/p>\",\"8\":\"7:23\",\"7\":[{\"col1\":\"string quartet\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"composer\",\"col2\":\"Hsin-Lei Chen\"},{\"col1\":\"violin\",\"col2\":\"Can Gao and YaJing Su\"},{\"col1\":\"viola\",\"col2\":\"WenTing Kang\"},{\"col1\":\"cello\",\"col2\":\"YiChen Yang\"}],\"12\":\"\",\"10\":\"\",\"14\":\"2004\"}}', '2015-02-01 19:50:40', '2015-02-01 19:50:40', '523a3fb2-89c8-49c3-be7f-6fac2c7f0bce');
INSERT INTO `craft_entryversions` (`id`, `entryId`, `sectionId`, `creatorId`, `locale`, `notes`, `data`, `dateCreated`, `dateUpdated`, `uid`) VALUES ('278', '73', '3', '1', 'en_us', NULL, '{\"authorId\":\"1\",\"title\":\"By the Light of Nature\",\"slug\":\"by-the-light-of-nature\",\"postDate\":1377536040,\"expiryDate\":null,\"enabled\":1,\"fields\":{\"43\":\"n\",\"5\":[\"409\"],\"4\":[\"74\",\"75\"],\"41\":[\"76\"],\"3\":\"<p>\\r\\n\\t  The perception of achieving the concept of leaving blank for imagination to run without having the standard traditional Chinese music\'s hetrophony is the main topic of this work.<\\/p><p>\\r\\n\\t Performance Review<\\/p><p>\\r\\n\\t The other premiere (played by all four musicians) was contemporary composer Chen Hsin-Lei\\u2019s By the Light of Nature, a musical realization of the concept of \\u201cnothingness\\u201d or \\u201cblankness,\\u201d described in the notes as \\u201cone of the spiritual cores of Chinese art.\\u201d To give you a partial idea of that concept, imagine something that is hidden from you, like a village that you can\\u2019t see because there\\u2019s a mountain in front of it. This most impressive work included some apparently pre-recorded digital sounds, thus it interrupt performers\' sense of coordination to count together. Performers can grad a hint or find their own clue of tempo from the tape part. Instruments are the color. Linearly, each instrument has limited freedom of it\'s own pulse. Their unique timbre gives diversity of texture. However, there are points they meet up together to create tension and resolve. Each single one of them has its sound world, yet, together, they are one work in harmony, a pleasing state of agreement or orderly combination of elements in a whole.<\\/p>\",\"8\":\"6:59\",\"7\":[{\"col1\":\"dizi\"},{\"col1\":\"sheng\"},{\"col1\":\"huqing\"},{\"col1\":\"pipa\"},{\"col1\":\"computer music\"}],\"11\":\"audio\",\"9\":[{\"col1\":\"conductor\",\"col2\":\"Aikhai Peng\"}],\"12\":\"\",\"10\":\"\",\"14\":\"2012\"}}', '2015-02-01 19:58:06', '2015-02-01 19:58:06', 'ddbadc81-9e0b-4ed9-ba50-0c4dcd7ff8e8');
