INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('51', 'field', '3', 'en_us', ' the four orchestral suites called ouvertures by their author bwv 1066 1069 are four suites by johann sebastian bach the name ouverture refers only in part to the opening movement in the style of the french overture in which a majestic opening section in relatively slow dotted note rhythm in duple meter is followed by a fast fugal section in triple meter then rounded off with a short recapitulation of the opening music more broadly the term was used in baroque germany for a suite of dance pieces in french baroque style preceded by such an ouverture this genre was extremely popular in germany during bach s day and he showed far less interest in it than was usual robin stowell writes that telemann s 135 surviving examples represent only a fraction of those he is known to have written 1 christoph graupner left 85 listed in his wikipedia entry and johann friedrich fasch left almost 100 listed in his wikipedia entry bach did write several other ouverture suites for solo instruments notably the cello suite no 5 bwv 1011 which also exists in the autograph lute suite in g minor bwv 995 the keyboard partita no 4 in d bwv 828 and the overture in the french style bwv 831 for keyboard the two keyboard works are among the few bach published and he prepared the lute suite for a monsieur schouster presumably for a fee so all three may attest to the form s popularity scholars believe that bach did not conceive of the four orchestral suites as a set in the way he conceived of the brandenburg concertos since the sources are various as detailed below ');
