INSERT INTO `craft_searchindex` (`elementId`, `attribute`, `fieldId`, `locale`, `keywords`) VALUES ('188', 'field', '3', 'en_us', ' starts with the beginning of a pop song because of the glance of you among people i can t forget your face after the glance you are stuck everything is already written is destined i was a very rational love life was never my priority thus i could not understand johannes brahms love to the one woman through out life until i met a person i realized that staying quietly beside clara might have been the only thing brahms wished for i love this person more and more day by day the happier i felt the more painful i experienced the piece describes the contrasts in between the extreme emotions from tonal to atonal from purity to density from rational to emotional life is a process of repeating and circulating however every time it does not go back to exactly same place it changes a little the piece ends in e major which is a major this higher than the beginning it contains quotation another pop song at least i have you i am afraid that it s gonna be too late and i am going to hold you tight which is symbolization of sublime no matter what i am thankful that i loved ');
